import React from 'react'
import notFound from '../../images/not-found.jpg'

export default function NotFound() {
  return (

    <div className='text-center mx-auto '>
        <div className="row">
      <img src={notFound} class="img-fluid" alt="" />
      </div>
    </div>



  )
}
